// Display the value returned from getText() on MadLib object
import React, { Component } from "react";

class Story extends Component {
  render() {
    return (
      <div>
        <div
          style={{
            backgroundColor: "#FFDE00",
          }}
          class="w-auto"
        >
          <p>{this.props.text}</p>
        </div>
      </div>
    );
  }
}

export default Story;
